import './App.css';
import {Routes, Route, useLocation, useNavigate} from 'react-router-dom';


function App() {

  return (
    <div className="App">
      {useLocation().pathname !== '/'}
        <Routes>
          <Route></Route>
        </Routes>
    </div>
  );
}

export default App;
